import React from 'react';
// components
import Headerwhite from './layouts/Header_white';
import Header from './layouts/Header';
import Footer from './layouts/Footer';
// FontAwesome
import './FontAwesome';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'

function HomePage(){
    return(
        <div>
            <Headerwhite/>         
            <div className="home" >
               <div className="slider">
                   <div className="home-slider-prev">
                    <FontAwesomeIcon icon="angle-left" alt="home-prev"/>
                   </div>
                   <div className="home-slider-next">
                   <FontAwesomeIcon icon="angle-right" alt="home-next" />
                   </div>        
                   <div className="dots"></div>
                   <img src={process.env.PUBLIC_URL +"/slider_1.jpg"} alt="slider"/>
               </div>
            </div>
            <Footer/>       
        </div>
    )
};
export default HomePage;
